import React from 'react';
import TaskItem from './TaskItem';

const TaskList = ({ tasks, onDelete, onToggle }) => {
  return (
    <>
      {tasks.map((task) => (
        <TaskItem key={task._id} task={task} onDelete={onDelete} onToggle={onToggle} />
      ))}
    </>
  );
};

export default TaskList;
